    <script>
        // Password protection
        const EXPECTED_HASH = '9b95f2850a14896b727122ad8391cbb2f63abcda0925aaa28717a153a4b65a38';
        const AUTH_KEY = 'stubhub_auth';

        async function hashPassword(password) {
            const encoder = new TextEncoder();
            const data = encoder.encode(password);
            const hashBuffer = await crypto.subtle.digest('SHA-256', data);
            const hashArray = Array.from(new Uint8Array(hashBuffer));
            return hashArray.map(b => b.toString(16).padStart(2, '0')).join('');
        }

        async function checkPassword() {
            const input = document.getElementById('password-input');
            const hash = await hashPassword(input.value);

            if (hash === EXPECTED_HASH) {
                localStorage.setItem(AUTH_KEY, hash);
                showDashboard();
            } else {
                input.classList.add('error');
                input.value = '';
                setTimeout(() => input.classList.remove('error'), 500);
            }
        }

        function showDashboard() {
            document.getElementById('password-overlay').style.display = 'none';
            document.getElementById('main-content').classList.add('visible');
            initializeChart();
        }

        // Check on page load if already authenticated
        async function checkAuth() {
            const savedHash = localStorage.getItem(AUTH_KEY);
            if (savedHash === EXPECTED_HASH) {
                showDashboard();
            }
        }

        // Allow Enter key to submit
        document.getElementById('password-input').addEventListener('keypress', function(e) {
            if (e.key === 'Enter') checkPassword();
        });

        // Check auth on load
        checkAuth();

Section 108": "100 Sections", "Section 133": "100 Sections", "Section 143": "100 Sections", "Section 120": "100 Sections", "Section 110": "100 Sections", "Section 142": "100 Sections", "Section 111": "100 Sections", "Section 134": "100 Sections", "Section 118": "100 Sections", "Section 119": "100 Sections", "Section 112": "100 Sections", "Section 2158947": "Other Sections", "Section 2158962": "Other Sections", "Section 2158970": "Other Sections", "Section 2158976": "Other Sections", "Section 2158977": "Other Sections"};  // Maps section name -> group name

        // Load saved visibility state
        function loadVisibility() {
            try {
                const saved = localStorage.getItem(STORAGE_KEY);
                if (saved) {
                    return JSON.parse(saved);
                }
            } catch (e) {
                console.log('Could not load saved visibility');
            }
            return null;
        }

        // Save visibility state
        function saveVisibility(visibility) {
            try {
                localStorage.setItem(STORAGE_KEY, JSON.stringify(visibility));
            } catch (e) {
                console.log('Could not save visibility');
            }
        }

        // Apply saved visibility to chart data
        function applyVisibility(data, saved) {
            if (!saved) return data;

            data.data.forEach((trace, i) => {
                if (trace.name && saved[trace.name] !== undefined) {
                    trace.visible = saved[trace.name];
                }
            });
            return data;
        }

        // Get current visibility from plot
        function getCurrentVisibility(plotDiv) {
            const visibility = {};
            plotDiv.data.forEach(trace => {
                if (trace.name) {
                    visibility[trace.name] = trace.visible === true ? true :
                                             trace.visible === 'legendonly' ? 'legendonly' : true;
                }
            });
            return visibility;
        }

        // Initialize chart
        const saved = loadVisibility();
        const modifiedData = applyVisibility(chartData, saved);

        Plotly.newPlot('chart', modifiedData.data, modifiedData.layout, {
            responsive: true,
            displayModeBar: true,
            modeBarButtonsToRemove: ['lasso2d', 'select2d']
        });

        // Save visibility when legend is clicked
        const chartDiv = document.getElementById('chart');
        chartDiv.on('plotly_legendclick', function(data) {
            // Wait for Plotly to update, then save
            setTimeout(() => {
                const visibility = getCurrentVisibility(chartDiv);
                saveVisibility(visibility);
                updateGroupButtons();
            }, 100);
        });

        chartDiv.on('plotly_legenddoubleclick', function(data) {
            // Get the clicked trace name
            const clickedTrace = data.data[data.curveNumber];
            const traceName = clickedTrace.name;
            const groupName = sectionGroups[traceName];

            // If this trace belongs to a section group, toggle the entire group
            if (groupName) {
                toggleGroup(groupName);
                return false;  // Prevent default Plotly isolate behavior
            }

            // For non-section traces (categories), let default behavior happen
            setTimeout(() => {
                const visibility = getCurrentVisibility(chartDiv);
                saveVisibility(visibility);
                updateGroupButtons();
            }, 100);
        });

        // Click on plot line to isolate/restore (per-subplot)
        let preIsolateState = null;
        let isolatedTrace = null;
        let isolatedSubplot = null;

        chartDiv.on('plotly_click', function(data) {
            const clickedIndex = data.points[0].curveNumber;
            const clickedTrace = chartDiv.data[clickedIndex];
            // Determine which subplot this trace belongs to (by yaxis)
            const clickedYAxis = clickedTrace.yaxis || 'y';

            // Check if we're clicking the already-isolated trace
            if (isolatedTrace === clickedIndex) {
                // Restore previous state for this subplot only
                if (preIsolateState) {
                    const restoreIndices = [];
                    const restoreValues = [];
                    chartDiv.data.forEach((t, i) => {
                        const tYAxis = t.yaxis || 'y';
                        if (tYAxis === isolatedSubplot) {
                            restoreIndices.push(i);
                            restoreValues.push(preIsolateState[i]);
                        }
                    });
                    Plotly.restyle(chartDiv, {'visible': restoreValues}, restoreIndices);
                    saveVisibility(getCurrentVisibility(chartDiv));
                    updateGroupButtons();
                }
                preIsolateState = null;
                isolatedTrace = null;
                isolatedSubplot = null;
            } else {
                // Save current state before isolating
                preIsolateState = chartDiv.data.map(t => t.visible === true || t.visible === undefined ? true : 'legendonly');
                isolatedTrace = clickedIndex;
                isolatedSubplot = clickedYAxis;

                // Hide only traces in the same subplot, except the clicked one
                const updateIndices = [];
                const updateValues = [];
                chartDiv.data.forEach((t, i) => {
                    const tYAxis = t.yaxis || 'y';
                    if (tYAxis === clickedYAxis) {
                        updateIndices.push(i);
                        updateValues.push(i === clickedIndex ? true : 'legendonly');
                    }
                });
                Plotly.restyle(chartDiv, {'visible': updateValues}, updateIndices);
                saveVisibility(getCurrentVisibility(chartDiv));
                updateGroupButtons();
            }
        });

        // Group toggle functions
        window.toggleGroup = function(groupName) {
            const traceIndices = [];
            const currentlyVisible = [];

            chartDiv.data.forEach((trace, i) => {
                if (sectionGroups[trace.name] === groupName) {
                    traceIndices.push(i);
                    currentlyVisible.push(trace.visible === true);
                }
            });

            // If any are visible, hide all. If all hidden, show all.
            const anyVisible = currentlyVisible.some(v => v);
            const newVisible = anyVisible ? 'legendonly' : true;

            const update = {};
            traceIndices.forEach(i => {
                update[i] = newVisible;
            });

            Plotly.restyle(chartDiv, {'visible': traceIndices.map(() => newVisible)}, traceIndices);

            setTimeout(() => {
                const visibility = getCurrentVisibility(chartDiv);
                saveVisibility(visibility);
                updateGroupButtons();
            }, 100);
        };

        window.showAllSections = function() {
            const sectionIndices = [];
            chartDiv.data.forEach((trace, i) => {
                if (sectionGroups[trace.name]) {
                    sectionIndices.push(i);
                }
            });
            Plotly.restyle(chartDiv, {'visible': true}, sectionIndices);
            setTimeout(() => {
                const visibility = getCurrentVisibility(chartDiv);
                saveVisibility(visibility);
                updateGroupButtons();
            }, 100);
        };

        window.hideAllSections = function() {
            const sectionIndices = [];
            chartDiv.data.forEach((trace, i) => {
                if (sectionGroups[trace.name]) {
                    sectionIndices.push(i);
                }
            });
            Plotly.restyle(chartDiv, {'visible': 'legendonly'}, sectionIndices);
            setTimeout(() => {
                const visibility = getCurrentVisibility(chartDiv);
                saveVisibility(visibility);
                updateGroupButtons();
            }, 100);
        };

        // Update button states based on current visibility
        function updateGroupButtons() {
            const groupVisibility = {};
            chartDiv.data.forEach(trace => {
                const group = sectionGroups[trace.name];
                if (group) {
                    if (!groupVisibility[group]) {
                        groupVisibility[group] = { visible: 0, total: 0 };
                    }
                    groupVisibility[group].total++;
                    if (trace.visible === true) {
                        groupVisibility[group].visible++;
                    }
                }
            });

            document.querySelectorAll('.group-btn[data-group]').forEach(btn => {
                const group = btn.dataset.group;
                const stats = groupVisibility[group];
                if (stats) {
                    btn.classList.remove('active', 'partial');
                    if (stats.visible === stats.total) {
                        btn.classList.add('active');
                    } else if (stats.visible > 0) {
                        btn.classList.add('partial');
                    }
                }
            });
        }

        // Initial button state update
        updateGroupButtons();

        // Auto-refresh every 60 seconds
        let lastModified = '2026-01-27 19:29:48';

        async function checkForUpdates() {
            try {
                const response = await fetch(window.location.href, {
                    method: 'HEAD',
                    cache: 'no-cache'
                });
                // Just reload the page - simpler approach
                window.location.reload();
            } catch (e) {
                // On error, still try to reload
                window.location.reload();
            }
        }

        // Refresh page every 60 seconds to get new data
        setTimeout(() => {
            checkForUpdates();
        }, 60000);

        // Show refresh note briefly on load if we have saved visibility (means refresh)
        if (saved) {
            const note = document.getElementById('refresh-note');
            note.classList.add('show');
            setTimeout(() => note.classList.remove('show'), 2000);
        }
        } // end initializeChart function
    </script>
